import Role from "../models/Role";
import User from "../models/User";

export const signIn = async (req, res) => {
   const data = req.fields;

   console.log(data.email);
   console.log(data.password);

   const role1 = await Role.findOne({ name: "admin" });
   console.log(role1._id);

   const userFound = await User.findOne({ email: data.email }).populate('role');

   if (!userFound) return res.json({ errorEmail: "El usuario no existe" });

   const matchPassword = await User.comparePassword(data.password, userFound.password);

   if (!matchPassword) return res.json({ errorPassword: "Contraseña incorrecta" });

   res.json(userFound);

}

